ra Gudgeon, Tricia Miranda\n\n\n#Rihanna #BBHMM\n\n\n~ a T.Milly Production ~"}, {:id=>88, :url=>"BN2FoQkoIWM", :yt_author=>"JianVP", :yt_pub_date=>"2015-11-05T02:12:14.000Z", :yt_count=>"379", :yt_title=>"Jian | \"Moving Mountains\" - Disclosure", :yt_description=>"There is a time and point in life when all that we know and who are will be tested. We can stay on our current path and continue to do what we've always done or we can choose to change, become a better, wiser people. We can move forward and let go all of our old habits that do not serve us anymore. \nThis video is dedicated to all those who are undergoing those changes to become better versions of themselves. Keep pushing. Keep moving your mountains. \n\nChoreography by Jian\n\nFilmed and Edited by Q Burdette\n\nDancers:\nJian\nLee Daniel\nDenzel Chisolm\nMemo Martinez\nKendrick Mart"}, {:id=>61, :url=>"l9rjZdWhA4c", :yt_author=>"saekell", :yt_pub_date=>"2015-07-30T04:11:53.000Z", :yt_count=>"1647", :yt_title=>"The Mighty Experience", :yt_description=>"*No copy right infringement This is for creative purposes only*\n\nThe greatest places of success are found in giving, sharing and loving. I love people and what happens when we love each other. They went through a quick but maximized process of God leading me to  inspire, impart, push and develop them. I saw growth, determination and drive but most of all I saw ordinary people find what makes them MIGHTY and own it. We are all mighty when we discover our identity and live in that place. \n\nThis is featuring the Movement Lifestyle Work-Studies Summer 2015\n\nLara & Collin\nGreer & Vienna\nJesse & KP\nKileigh & Mitchell\nLiz & London\nKeyon & Brittany\nLauren & Geo\nJasmine & Jasmin\nTony & Patrice\nAllie & Doug\nLexi & Jason\nJoel\n\nChoreogaphy-Mykell WIlson aka Mighty Mykell \nFilmed by Q Burdette"}, {:id=>104, :url=>"ybW7aSBBrAo", :yt_author=>"JustinBieberVEVO", :yt_pub_date=>"2015-11-24T20:00:02.000Z", :yt_count=>"1877401", :yt_title=>"Justin Bieber -