 :yt_title=>"August Alsina - I Luv This Sh*t - Tricia Miranda Choreography - Filmed by @TimMilgram", :yt_description=>"August Alsina - I Luv This Sh*t - Choreography by Tricia Miranda\nFilmed & Edited by Tim Milgram: http://youtube.com/timmilgram\n\nFollow us: \nhttp://instagram.com/1TriciaMiranda\nhttp://instagram.com/TimMilgram\n\nFeaturing: Denzel Chisolm, Devin Solomon, Josh Williams, Guapo Clarke, Darrion Gallegos, Richard Curtis, Markwell Ysaguirre, TeeTee, Amanda Grind, Allison Buczkowski, Nicole Kirkland, Kiara Gudgeon, Paris Jackson, Domonique Battiste\n\nArtist: August Alsina ft. Trinidad James\nSong: I Luv This Shit\n\n\n~ a T.Milly Production ~"}, {:id=>45, :url=>"ER10Zouud0o", :yt_author=>"Rhapsody James", :yt_pub_date=>"2014-11-10T02:29:16.000Z", :yt_count=>"10671", :yt_title=>"Trey Songz (feat Nicki Minaj) - Touchin, Lovin Visual Concept by Rhapsody James", :yt_description=>"***I DO NOT OWN ANY RIGHTS TO THIS SONG. THIS VIDEO IS FOR CREATIVE PURPOSES ONLY!\n\nDirector / Choreographed by:\nRhapsody James\n\nFilmed & Edited by:\nRhapsody James\n\nFeaturing:\nChristian Owens\nMichelle Mitchenor\n\nDancers:\nMichelle Mitchenor\nLaurel Thomson\nMelany Centeno"}, {:id=>108, :url=>"Is3Sk-qQB1s", :yt_author=>"Jared Jenkins", :yt_pub_date=>"2016-01-05T17:01:05.000Z", :yt_count=>"3507", :yt_title=>"Alessia Cara | I'm Yours | Jared Jenkins", :yt_description=>"Absolutely love this song. Decided to put a little fun concept to this amazing track. Hope you guys enjoy it. Comment, Share, Enjoy :)\n\nTrack: Alessia Cara - I'm Yours\nCinematography - Shar Adrias"}, {:id=>44, :url=>"u3eJycW4DtA", :yt_author=>"LaJon Dantzler", :yt_pub_date=>"2014-08-19T07:24:19.000Z", :yt_count=>"11899", :yt_title=>"QUE - Og Bobby Johnson | Choreography By LaJon Dantzler @LajonD IG:Smokedfree @whoisque", :yt_description=>"Que - Og Bobby Johnson | Choreography By LaJon Dantzler \nShot & Edited by @Movementsbyshar IG:_movementsbysharremenart\nArt by: KremenArt.com\n\nFollow :-)\nhttp://Twitter.com/LajonD\nhttp://instagram.com/smokedfreezone"}, {:id=>72, :url=>"088vy2cqroA", :yt_author=>"URBAN DANCE CAMP", :yt_pub_date=>"2015-05-12T11:25:18.000Z", :yt_count=>"984687", :yt_title=>"Money On My Mind - Sam Smith / Keone & Mariel Madrid Choreography / 310XT Films / URBAN DANCE CAMP", :yt_description=>"• WB: http://theUrbanDanceCamp.com\n• FB: http://facebook.com/theUrbanDanceCamp\n• YT: http://youtube.com/UrbanDanceCamp\n\n• CHOREOGRAPHY BY : Keone & Mariel Madrid\n• MUSIC : \"Money On My Mind\" (MK Remix) by Sam Smith\n• FILM PRODUCTION : http://www.310XT.com\n\n• DANCERS (L to R) : \nNasir Sirikhan (Quick Crew)\nChris Martin (Cookies)\nMariel Madrid (Cookies) \nKeone Madrid (Cookies)  \nPat Cruz (The Company)\n\n• ABOUT THE UDC : The Urban Dance Camp is the world's leading dance intensive education. The annual international workshop event has become after many years the best summer intensive for choreography-oriented dance styles, with the highest standard of teaching and unique talents from around the world. The Urban Dance Camp presents every year an amazing line up with dance legends, youtube stars and top international choreographers from Asia, Europe and the USA. All of them proved their skills in the past years and become the best and most qualified educators for choreography-oriented participants. \n\nThe UDC 2016 offers you more than 170 classes over a period of 50 days. The workshops are ideal for dancers, teachers and choreographers with experiences. The level of the classes is for intermediate, advanced and professional dancers. The UDC is not for beginners, who never danced before. Age restriction: Participants have to be at least 16 years. \n\nEnjoy 255 hours of workshops with up to 33 teachers and participants from USA, Canada, Australia, United Kingdom, Germany, France, Spain, Italy, Israel, Japan, Mexico, Russia, China, Singapore and many more! \n\n////////////////////////////////////////////////////////////////\n• WEBSITE : www.theUrbanDanceCamp.com\n• CONTACT : info@theUrbanDanceCamp.com"}, {:id=>13, :url=>"NQ1LGCVXmPo", :yt_author=>"Karon Lynn", :yt_pub_date=>"2015-02-20T23:22:03.000Z", :yt_count=>"123732", :yt_title=>"Karon Lynn| @KaronLynnTV| @Jeremih | \"Planes\"", :yt_description=>"My class at Millennium Dance Complex Every Monday & Wednesday 4:30PM"}, {:id=>89, :url=>"BdNk85oIBHk#t=156", :yt_author=>"Nick DeMoura", :yt_pub_date=>"2015-07-16T22:17:32.000Z", :yt_count=>"794733", :yt_title=>"WHERE ARE Ü NOW - @Skrillex & @Diplo ft @JustinBieber | @NickDemoura Choreography #WhereAreUNow", :yt_description=>"We had SO much fun shooting this video to my dude @JustinBieber's song with @Skrillex & @Diplo.   Had this idea for a while, so I called up my dancer friends & @brazilinspires with his crew and we made magic happen!  Enjoy the video and lookout for more of my directing work!\n\nSpecial thanks to PRG for letting us use their LED Wall, Lights, Space & Crew... You guys rock!\n\n\nStarring Dancers:\n\nAde Willis\nMykell Wilson\nCJ Salvador\nJake Landgrebe\nTanner Clark\nMarkwell Ysaguirre\nJonathan Rabon\nYusuke Nakai"}, {:id=>53, :url=>"SK4jYxmJD_o", :yt_author=>"TheBeyShow Reloaded", :yt_pub_date=>"2014-09-12T15:43:46.000Z", :yt_count=>"6000104", :yt_title=>"Beyoncé - Flawless & Yoncé Live at MTV VMAs 2014", :yt_description=>"7/11 Live: https://www.youtube.com/watch?v=JZQGwusUSr4\nBeyoncé performs a Medley of Flawless & Yoncé Live at MTV Video Music Awards 2014"}, {:id=>51, :url=>"5zgWUcsiiUg", :yt_author=>"URBAN DANCE CAMP", :yt_pub_date=>"2013-02-15T10:16:13.000Z", :yt_count=>"2580640", :yt_title=>"Super Saiyan - Dragonball Z / Poreotics Crew Choreography, Dubstep Music / URBAN DANCE CAMP", :yt_description=>"• WB: http://theUrbanDanceCamp.com\n• FB: http://facebook.com/theUrbanDanceCamp\n• YT: http://youtube.com/UrbanDanceCamp\n\n• ARTISTS: Poreotics Dance Crew (Matt Nguyen, Can Trong Nguyen, Charles Viet Nguyen, Lawrence Devera, Justin Valles, Chad Mayate)\n\n• M.1: \"Super Saiyan are REAL\" by KillaKarisma \n• M.2: \"Who is Ready to Jump\" by Chuckie (Dillon Francis Remix) \n• M.3:  \"Coming Home\" by Skylar Grey (Arion Dubstep Remix)\n\n• FILM PRODUCTION: http://www.310XT.com\n\n• ABOUT THE UDC: The Urban Dance Camp is the world's leading dance intensive education. The annual international workshop event has become after many years the best summer intensive for studio-styles (choreography) as well as streetdance-styles, with the highest standard of teaching and unique talents from around the world. The Urban Dance Camp presents every year an amazing line up with dance legends, youtube stars and top international choreographers from Asia, Europe and the USA. All of them proved their skills in the past years and become the best and most qualified educators for choreography-oriented participants. \n\nThe UDC 2016 offers you more than 170 classes over a period of 50 days. The workshops are ideal for dancers, teachers and choreographers with experiences. The level of the classes is for intermediate, advanced and professional dancers. The UDC is not for beginners, who never danced before. Age restriction: Participants have to be at least 16 years. \n\nEnjoy 255 hours of workshops over 44 days and 33 teachers and participants from USA, Canada, Australia, United Kingdom, Germany, France, Spain, Italy, Israel, Japan, Mexico, Russia, China, Singapore and many more! \n\n////////////////////////////////////////////////////////////////\n• WEBSITE : www.theUrbanDanceCamp.com\n• CONTACT : info@theUrbanDanceCamp.com"}, {:id=>43, :url=>"lM0Kdq3s64g", :yt_author=>"LaJon Dantzler", :yt_pub_date=>"2015-05-25T08:58:18.000Z", :yt_count=>"58117", :yt_title=>"Tink- Million | Choreography by La Jon Dantzler @Smokedfreezone", :yt_description=>"Tink - Million | Choreography By LaJon Dantzler \nFt. Luz Remigio \nCo. Choreography Pierce Cady - Penny\nShot By: Jason Santana  | @LeaveYourCool\nSmoke'd Free Zone \n\n\nShare this Video \nhttp://youtu.be/lM0Kdq3s64g\n\nSubscribe to my Channel \nhttp://youtube.com/dantzler28\n  \nFollow:\nhttp://instagram.com/smokedfreezone\nhttp://twitter.com/lajond\n\nwebsite: Coming soon\nwww.smokedfree.com\n\n\nFollow :-)\nhttp://Twitter.com/LajonD\nhttp://instagram.com/smokedfreezone"}, {:id=>54, :url=>"qp2cBXvuDf8", :yt_author=>"Moises NYC", :yt_pub_date=>"2014-06-26T03:28:31.000Z", :yt_count=>"19102503", :yt_title=>"Beyoncé - Super Bowl [4K Quality 2160p]", :yt_description=>"Excellence must be pursued, it must be wooed with all of one's might and every bit of effort that we have; each day there's a new encounter, each week is a new challenge. All of the noise and all of the glamour, all of the color all of the excitement, all of the rings and all of the money. These are the things that linger only in the memory. But the spirit, the will to excel, the will to win, these are the things that endure. "}, {:id=>36, :url=>"SV9n9BVI-qI", :yt_author=>"Jose Hollywood", :yt_pub_date=>"2015-02-05T07:09:00.000Z", :yt_count=>"528495", :yt_title=>"Omarion Ft. Chris Brown & Jhene Aiko- Post To Be Choreography by: Hollywood", :yt_description=>"From class at Movement Lifestyle in LA- Wednesday 630p\n\nHollywoodmovement.com"}, {:id=>55, :url=>"NuZSncZRpKE", :yt_author=>"DO PE", :yt_pub_date=>"2015-09-02T03:26:01.000Z", :yt_count=>"2203907", :yt_title=>"Nicki Minaj ft. Taylor Swift - Live VMA 2015", :yt_description=>"Follow me on Twitter: https://goo.gl/q9gzkB\n\nThe presentation of Nicki Minaj with special participation of Taylor Swift at the VMAs!\n\n They sang \"Trini Dem Girls,\" \"The Night Is Still Young\" and \"Bad Blood\"."}, {:id=>41, :url=>"zm9yiYC7Nqg", :yt_author=>"Jose Hollywood", :yt_pub_date=>"2014-01-08T18:08:43.000Z", :yt_count=>"2309882", :yt_title=>"Beyoncé \"YONCE\" - ft Charlize Glass - Choreography by Jose \"Hollywood\"", :yt_description=>"Beyoncé - Yonce Choreography by Hollywood ft. Charlize Glass\nVideo Production by Tim Milgram: http://youtube.com/timmilgram\n\n\nDancers:\nCharlize Glass, Angel Gibbs, Kaelynn \"KK\" Harris, Jaira Miller, Momo Koyama, Kiara Gudgeon, Jamie Hauptmann, Joey Antonio, Antwon Collier, Micheal Love, Eddie Parks, Amanda Grind, Marino Tomita, Darina Littleton, Quinetta \"Q\" Wilmington\n\n\nSong: Beyonce - \"Yoncé\" (Partition)\n\n\n~ a T.Milly Production ~"}, {:id=>96, :url=>"Yh9zsIpiaRk", :yt_author=>"Callmekcookz", :yt_pub_date=>"2015-11-17T18:27:48.000Z", :yt_count=>"12843", :yt_title=>"A MUST SEE: Kelly Rowland Live Performance Medley- Choreography By: Keenan Cooks", :yt_description=>"Check out my new latest project, Kelly Rowland Live performance medley. I'm so excited to share this project with you guys!! I've had this concept and choreography in my head for about a year, and finally decided to go for it.  LIKE/COMMENT/SHARE\n\nSong:\nI'm Dat Chick \nWork \nLike This/Say Yes\nMotivation \nKisses Down Low\nForever and A Day\n\nShot by: Movement Film Productions by Shar"}, {:id=>84, :url=>"IZtYvi_ydx0", :yt_author=>"Josh Williams", :yt_pub_date=>"2015-10-05T20:39:16.000Z", :yt_count=>"90431", :yt_title=>"@TPain - Disa My Ting Choreo Collab by @JoshLildeweyWilliams @Flaminiagenoese", :yt_description=>"Me and Fla love to dance with each other! And I personally wanted to do this collab as a going away present for her going back to Italy! She wants to live here so bad! And deserves to (in my eyes) live here more then anybody else! Because she works hard! She has a big heart! She's humble and just overall a normal person that wants nothing but the best for others..! I love you fla..! I hope to see you soon! Actually I know I'll see you soon because we're gonna get u back to LA! Hope everyone enjoys the work of me and Fla! She's amazing! Follow her and all of the dancers in the video!"}, {:id=>64, :url=>"oe6ACKMyF7I", :yt_author=>"Tricia Miranda", :yt_pub_date=>"2015-09-25T19:46:41.000Z", :yt_count=>"9697564", :yt_title=>"Dawin ft Silento - Dessert -  @_TriciaMiranda Choreography | Filmed by @TimMilgram #DessertDance", :yt_description=>