nel: \nhttps://www.youtube.com/1milliondancestudioasia\n\nOFFICIAL WEBSITE:\nhttps://www.1milliondance.com\n\nINSTAGRAM:\nhttps://instagram.com/1milliondance\n\nFACEBOOK:\nhttps://www.facebook.com/1milliondancestudio\n\n\n1MILLION Dance Studio & 1MILLION Dance Tutorials"}, {:id=>110, :url=>"YF8WPsyA0aE", :yt_author=>"JidennaVEVO", :yt_pub_date=>"2016-01-08T08:00:00.000Z", :yt_count=>"796370", :yt_title=>"Jidenna - Knickers", :yt_description=>"Jidenna \"Knickers\" is available on iTunes: http://smarturl.it/Knickers \nGoogle Play: http://smarturl.it/Knickers_GP\nSpotify: http://smarturl.it/Knickers_Spotify\nAmazon: http://smarturl.it/Knickers_Amazon\nDeezer: http://smarturl.it/Knickers_Deezer\n\nFollow Jidenna here: \nhttps://twitter.com/Jidenna\nhttps://www.instagram.com/jidenna\nhttps://www.facebook.com/jidenna\nhttp://www.jidenna.com\nJidenna \"Knickers\" is available on iTunes: http://smarturl.it/Knickers \nGoogle Play: http://smarturl.it/Knickers_GP\nSpotify: http://smarturl.it/Knickers_Spotify\nAmazon: http://smarturl.it/Knickers_Amazon\nDeezer: http://smarturl.it/Knickers_Deezer\n\nFollow Jidenna here: \nhttps://twitter.com/Jidenna\nhttps://www.instagram.com/jidenna\nhttps://www.facebook.com/jidenna\nhttp://www.jidenna.com\n\nAlso available from Wondaland Records / Epic Records: \n\"Wondaland Presents: The Eephus\" at iTunes: http://smarturl.it/TheEephus\nAmazon MP3: http://smarturl.it/EephusAmz\nSpotify: http://smarturl.it/EephusSptfy\nGooglePlay: http://smarturl.it/EephusGP\n\n(C) 2015 Epic Records, a division of Sony Music Entertainment\nAlso available from Wondaland Records / Epic Records: \n\"Wondaland Presents: The Eephus\" at iTunes: http://smarturl.it/TheEephus\nAmazon MP3: http://smarturl.it/EephusAmz\nSpotify: http://smarturl.it/EephusSptfy\nGoogle Play: http://smarturl.it/EephusGP\n\n(C) 2015 Epic Records, a division of Sony Music Entertainment"}, {:id=>48, :url=>"KASqAyy0-5k", :yt_author=>"Christopher Martin", :yt_pub_date=>"2014-01-31T23:31:53.000Z", :yt_count=>"487088", :yt_title=>"Chris Martin | All That Matters", :yt_description=>"I don't want to write a description. \n\nSo I won't.\n\n(I mean to be honest you should probably be outside anyways exploring the world but instead you are sitting here wasting away as you watch this very stupid video. If I could give you back the 3 minutes and 37 seconds you spent watching this video I would. But I can't because magic ISN'T REAL. You know what's real? Hip hop in da streets, drilling for natural gas, healthcare reform, healthcare deform and Kanye West. So I hope you learned something from this. Never trust a description box.)\n\nSong: All That Matters\nArtist: Justin Bieber\nChoreography: Chris Martin\nFilmed and edited by: Anthony Quidachay\nDancers: from left to right in that first shot where you like....see all the dancers\nCarlo Darang @CarloDarang\nRobbie Mesina @rahbaybay\nPaul Ross @paulrossssss\nMikey Mesina @immikeyiiirock \nVinh Nguyen @v1nh\nKevin Nguyen @KevyWind\n\n\n\n\n\n*NO COPYRIGHT INFRINGEMENT INTENDED* \"This video uses copyrighted material in a manner that does not require approval of the copyright holder. It is a fair use under copyright law. \n\"quotation of excerpts in a review or criticism for purposes of illustration or comment; quotation of short passages in a scholarly or technical work, for illustration or clarification of the author's observations; use in a parody of some of the content of the work parodied; summary of an address or article, with brief quotations, in a news report; reproduction by a library of a portion of a work to replace part of a damaged copy; reproduction by a teacher or student of a small part of a work to illustrate a lesson; reproduction of a work in legislative or judicial proceedings or reports; incidental and fortuitous reproduction, in a newsreel or broadcast, of a work located in the scene of an event being reported.\""}, {:id=>102, :url=>"VpMUmVQ_1F8", :yt_author=>"immaBEAST Dancers", :yt_pub_date=>"2015-11-25T00:46:25.000Z", :yt_count=>"173092", :yt_title=>"Beyonce - Partition | Janelle Ginestra Dance Choreography", :yt_description=>"First official video on our immaBEASTDancers Crew Channel! Subscribe now for more! Like us on Facebook: http://Facebook.com/immabeastdancers\nInstagram: @immabeastco\n\nChoreography by: Janelle Ginestra (IG: @JanelleGinestra) \nStarring: Zacc Milne (IG: @ZaccMilne)\nVideo by: Brazil (IG: @brazilinspires) http://gum.co/dancevideos"}, {:id=>93, :url=>"KO_3Qgib6RQ", :yt_author=>"Missy Elliott", :yt_pub_date=>"2015-11-12T14:00:04.000Z", :yt_count=>"33347933", :yt_title=>"Missy Elliott - WTF (Where They From) ft. Pharrell Williams [Official Video]", :yt_description=>"Missy Elliott's new single \"WTF (Where They From)\" ft. Pharrell Williams available now! \nDownload: http://smarturl.it/WTFdownload\nStream: http://smarturl.it/WTF_spotify\n\nDirected by: Dave Meyers & Missy Elliott\n\nMissy Elliott - \"WTF (Where They From)\" ft. Pharrell Williams [Official Video]\n\nFollow Missy Elliott:\nhttp://www.missy-elliott.com\nhttp://www.twitter.com/missyelliott\nhttp://www.instagram.com/MissyMisdemeanorElliott \nhttp://www.facebook.com/missyelliott \nhttp://www.youtube.com/missyelliott \nhttp://soundcloud.com/missyelliott \n\nFollow Pharrell Williams: \nhttp://pharrellwilliams.com/\nhttps://twitter.com/Pharrell\nhttps://www.instagram.com/pharrell/\nhttps://www.facebook.com/Pharrell/ \nhttps://www.youtube.com/PharrellWilliamsVEVO\n\nFollow Dave Meyers:\nhttp://www.davemeyers.com\nhttp://instagram.com/dave_meyers\nhttp://twiter.com/_davemeyers\nhttp://www.facebook.com/Director-Dave-Meyers-212684382109440\n\nFollow Knoko Films: \nhttp://instagram.com/Kingkoke_insta\nhttp://instagram.com/zanmifilms\nhttp://twiter.com/zanmifilms"}, {:id=>58, :url=>"rlqqMOjusH8", :yt_author=>"Ian Eastwood", :yt_pub_date=>"2013-07-22T07:11:22.000Z", :yt_count=>"3186994", :yt_title=>"Ian Eastwood Choreography | \"Strawberry Bubblegum\" - Justin Timberlake", :yt_description=>"What's up guys...first of all, wanna apologize for the delay of this video, but decided it was for the better not to drop it on a holiday...and line it up with the day JT performs in Chicago, the city of my birth, & the city this very video was produced in.\n\nBefore I get to the meaning of this video I just want to say I'm so excited to be lucky enough to share this final product with you guys...I have worked so painfully hard on it getting to this point and I am so proud of what I have created not only with the video but for the first time in a long time of choreography pieces I am really proud of how much I feel like I'm just \"DANCING\" again in this video...now down to the serious business...lol.\n---\nThis video to me is about a lot of things & nothing all at the same time, I know that may not make sense but I'll try to make sense of it. haha. To me this video (even though it was incredibly planned out) is my representation of the joy of spotanaeity and simple summer fun without a care in the world. I've really been trying to live by a phrase lately that my mother grew up telling me...\"Joie de vivre\" its a french phrase meaning: \"the joy of life\". It's really simple yet so effective and thats what I went for when I created this dance, envisioned this concept, and created the video to follow it all up. You all know I am definitely a sap for the books, and I create emotional piece after emotional piece...but sometimes...like this time... it doesn't have to be so deep and you can just ENJOY yourself. That's what I'm learning in my life lately and it has led me to become much happier...I'm young and have so much time for the things I want in my life to come to fruition and by realizing that now,  instead of fabricating and force fitting happiness & and joy into my stress... they have been finding their own way to ME. It may seem like such a simple thing...happiness... but life makes it seem so complex & that is why it's so hard to achieve. My advice, and the purpose for this video...stop thinking so hard...step back and smell the roses once in awhile...if you are a good person and you do good things... every thing you want out of life will find its way to you. \n\nIf you enjoy choreographing-do it, if you like the way people dance-use them, if you enjoy someones company, presence, and all around energy-put them in your video...in a bathing suit, (haha), if you like your friends' work ethic and final products-use them to produce your vision, if you love your hometown- fly & film there, if you miss your hometown friends-invite them, if your proud of your city's beauty-show it off, if you love your family-let them be there for you. \n\nThose are the reasons behind every decision I made behind this video & I hope it comes through loud and clear. \n\nThank you all for your continued support... I wake up so many mornings shocked at the life I've been able to build for myself... there are so many things that have got me to where I am today but one that I cannot forget is the love & support of every single viewer to date. I uploaded my first video to youtube over 7 years ago when I was still 12 years old...100 videos later here I am. Thank you. I love you all."}, {:id=>57, :url=>"70G2qzAgLSQ", :yt_author=>"George jones jr.", :yt_pub_date=>"2015-04-19T07:24:06.000Z", :yt_count=>"1325", :yt_title=>"August Alsina \"Numb\" | George Jones Jr Choreography| Club Jete", :yt_description=>"First I DO NOT OWN THE RIGHTS TO THIS MUSIC!!!! \n\nThis is a piece I Choreographed for Club Jete in West Hollywood! Just trying to bring the audience Something they wouldn't normally see at these performances. thanks to the dancers Lee Daniel, Leo Lam, JC Ryan, And FeFe Burgos. \n\nChoreography: George Jones Jr\nSong: \"Numb\" By August Alsina\n\nThanks for watching, pls repost, like , and subscribe."}, {:id=>49, :url=>"MavvyR7s5tw", :yt_author=>"Christopher Martin", :yt_pub_date=>"2012-07-09T01:22:48.000Z", :yt_count=>"710916", :yt_title=>"Chris Martin | Bad Girl", :yt_description=>"Well well well, the dreaded youtube description box we meet again. I never know what to write in these damn things. I mean I know its a description box for the video. Yet, wouldn't watching the video itself describe the video. Its like reading a Hunger Games book while at the Hunger Games movie. Utterly absurd. I dont know if you read this but if you did I hope you know. I dont really think anybody could finish that book in the time span of the film. I mean lezbehonest. see ya!\n\nFollow me on twitter if you must: @pikacheerio\n\n\nSong: Bad Girl\nArtist: Usher\nChoreography: Chris Martin\nDancers: Carlo Darang & Nic Ballecer \nFilmed and Edited: Anthony Quidachay\nContact: cmartinbookings@gmail.com\n\n\n\n\n*NO COPYRIGHT INFRINGEMENT INTENDED* \"This video uses copyrighted material in a manner that does not require approval of the copyright holder. It is a fair use under copyright law. \n\"quotation of excerpts in a review or criticism for purposes of illustration or comment; quotation of short passages in a scholarly or technical work, for illustration or clarification of the author's observations; use in a parody of some of the content of the work parodied; summary of an address or article, with brief quotations, in a news report; reproduction by a library of a portion of a work to replace part of a damaged copy; reproduction by a teacher or student of a small part of a work to illustrate a lesson; reproduction of a work in legislative or judicial proceedings or reports; incidental and fortuitous reproduction, in a newsreel or broadcast, of a work located in the scene of an event being reported.\""}, {:id=>11, :url=>"UU2OPadP56I", :yt_author=>"MovementLifestyle", :yt_pub_date=>"2011-12-17T07:59:41.000Z", :yt_count=>"1156065", :yt_title=>"Lyle Beniga | Wale - Bait [HD] [Best viewed 720p & up]", :yt_description=>"6 hours spent to teach and film.  Went by like clockwork thanks to all these amazing dancers.  Special shoutout to Shaun Evaristo, Nick DeMoura, Amanda Grind and Megan Curameng for the assistance that day.\n\nAlso, shoutout to WorldStarHipHop.com for reposting this on their blog: http://www.worldstarhiphop.com/videos/video.php?v=wshhDiuMJj17ub156788\n\n- LB\n\nBENIGA.com\ntwitter.com/lylebeniga\nyoutube.com/lbeniga1\n\nREGISTER FOR mL's theTOUR\nwww.themovementlifestyle.com/tour.php\n\nConcept by Lyle Beniga\n\nChoreographer\nLyle Beniga\n\nDirector of Photography\nNick DeMoura\n\nAssistant Director of Photography\nShaun Evaristo\n\nEditor\nThad Reid\n\nAssistant to Choreographer\nAmanda Grind\n\n\nFeatured Dancers in order of appearance:\nJohnny Erasme\nDevin Jamieson\nVinh Nguyen\nBam Martin\nJoesar Alva\nMykell Wilson\nAmanda Grind\nMike Fal\nIan Eastwood\nEllen Kim\nJeka Kalotkin\nJason Magsuci\nMarvin Millora\nJP Goldstein\nBrent Curtis\nLando Wilkins\nShaun Evaristo"}, {:id=>63, :url=>"pdFU-mOvKLk", :yt_author=>"Fordham Flava", :yt_pub_date=>"2014-04-15T03:48:48.000Z", :yt_count=>"1846", :yt_title=>"Fordham Flava - Spring Showcase 2014 Part 2", :yt_description=>""}, {:id=>101, :url=>"BOz8Uitu7dM", :yt_author=>"Bo Belza", :yt_pub_date=>"2015-11-25T16:29:57.000Z", :yt_count=>"1437", :yt_title=>"Bo Belza - Let It Go by James Bay", :yt_description=>"happy thanksgiving eve everyone!!! i couldnt be more thankful for where i am in life today and all of the things i experienced to get here. here's my latest concept video. \n\ni connected instantly with this song when i heard it: his voice, his lyrics, the way he sang; it reminded me of my life.i was going through a rough patch when i made this piece and i found myself immersed in this funk that i couldnt shake off. through our lives we go through situations that either break us or teach us a lesson. you think back to all the good that came with it, and you try to forget the bad.  you assure yourself that things will get better. but as time moves on, the bad only becomes worse. you see yourself changing, and the only thing left to do is walk away from whomever or whatever it may be. you learn to move past it so it becomes a distant memory, holding onto it closely. but sometimes, it's okay to just let it go. \n\nthank you to james bay for making wonderful music. a big thank you to my friends / dancers who made this piece and this video come to life, you guys are amazing. thank you jason for filming and editing this piece - without you, there would be no video.  thank you to kruti and amit and the metrodance studio for allowing us to film in your vicinity. thank you to my family and friends for your continuous support.Thank you God for blessing me with this talent to share with everyone.  thank you to my team- UFP - and  the east coast community for giving me a platform to share my craft. thank you to dance for being my outlet of creativity and my go-to when times get rough. and to you, thank you for giving me inspiration to make this piece.\n\nand thank you to everyone who took the time out to read this whole thing =P\n________________________________________________________________\n\nWeekly Class\nHouse of Movement\nWednesday 830 pm - 10pm\nPearl Studios 500 8th Ave. NY, NY\nWalk-ins $14.00 inquire about discounted rate.\n\nFor bookings email\nbelzad@gmail.com\n\nTwitter/ IG / FB- b0seff\n\n\n***NO COPYRIGHT INFRINGEMENT INTENDED*** \"This video uses copyrighted material in a manner that does not require approval of the copyright holder. It is a fair use under copyright law. \n\"quotation of excerpts in a review or criticism for purposes of illustration or comment; quotation of short passages in a scholarly or technical work, for illustration or clarification of the author's observations; use in a parody of some of the content of the work parodied; summary of an address or article, with brief quotations, in a news report; reproduction by a library of a portion of a work to replace part of a damaged copy; reproduction by a teacher or student of a small part of a work to illustrate a lesson;  reproduction of a work in legislative or judicial proceedings or reports; incidental and fortuitous reproduction, in a newsreel or broadcast, of a work located in the scene of an event being reported.\""}, {:id=>62, :url=>"UtS0DNsi20k", :yt_author=>"saekell", :yt_pub_date=>"2012-08-24T14:42:08.000Z", :yt_count=>"26541", :yt_title=>"theTOUR season2 | @Saekell | Mykell Wilson \"Rocko -Tomorrow\"", :yt_description=>"Some Summer fun with great people to promote the Movement Lifestyle Tour. The piece was inspired by Pep :)\r\n\r\nFilmed/Edited: Dario Minaya\r\n\r\nDancers: Aj Petrey, Rodney Chonia, Ade Willis, Sohey, Ian Eastwood, John Michael, Joesar Alva, Derrick Caldwell, B Thomas, Ava, Amanda Grind, Madison Benson, Ellen Kim, Andye J."}, {:id=>111, :url=>"fKy2k7Awi10", :yt_author=>"George jones jr.", :yt_pub_date=>"2016-01-03T17:02:02.000Z", :yt_count=>"2517", :yt_title=>"JLO \"Jenny From the Block\" | Choreography Submission | George Jones Jr", :yt_description=>"This is a submission that I created for Jennifer Lopez's Las Vegas Residency with the help of Director @Qburdette and Choreographer @smokedfreezone (Lajon Dantzler). \n\nMy Vision and intent with this piece is to display JLO, in a way that brings the new school swag, to the vibe that She is known for. Hard hitting, visual choreography, that highlights her! I found this mix of \"Jenny From the Block\" and decided to choreograph it because it felt like an Old school NYC club mix as well as just ritzy and upscale at the same time. It made me feel like I might be in a Vegas Club.  With this songs and many of her classics, JLO takes the audience with her back to the Bronx. My thinking is that it would be Interesting to feel it out in a new way. \nThe men in this submission are very ambiguous. I kept the story line to a minimum, and wanted to show case the use of a stage and framing the artist. \n\nFrom the top I wanted this submission to feel like part of the show.  Presenting A video content interlude, which transitions to a dance break. This of course could be used for a quick change or transition to new scene or set. The moment of dance break or moment of staging will then lead to a reveal of JLO in a long fur, Surrounded by men. the dancers can play many rolls and have the choreography tailored, props add if the scene requires. I kept it simple and visiual as if the men were trying to cater to her. I feel as though with all the success sometime you have to feel like I'm Jenny from the block. Do you know what I've be through to get to this place. I can't be touched. \n\nAll in all my goal was to present a piece that displays my ability make the hip hop element of JLOs show still relevant in the Las Vegas atmosphere with out it just being Hip Hop! Thank you for your time!"}, {:id=>65, :url=>"JKAqSM0_fvg", :yt_author=>"Chunwoo Kae", :yt_pub_date=>"2015-09-28T22:15:30.000Z", :yt_count=>"3338", :yt_title=>"BANJI TWERK TEAM at Washington Square Park Feat. Sángo - Me dê Amor.", :yt_description=>"Sango - Me dê Amor\n\nNeue Productions Inc. 2015"}, {:id=>69, :url=>"Oii2G_4jfCg", :yt_author=>"Sean Bankhead", :yt_pub_date=>"2014-09-30T23:58:48.000Z", :yt_count=>"119505", :yt_title=>"SEAN BANKHEAD - DRUNK TEXTING | CHRIS BROWN @itsSeanBankhead", :yt_description=>"IM BAAAAACK!!!\n\nsorry i've been so absent from youtube, but i miss y'all and got some new heat for all my fans who appreciate my work! \nlove you guys! enjoy :)\n\n\nwww.SeanBankhead.com"}, {:id=>82, :url=>"CMYOAJeZcfc", :yt_author=>"Antoine Troupe", :yt_pub_date=>"2014-10-14T17:14:16.000Z", :yt_count=>"1246613", :yt_title=>"ULTIMATE WHIP DANCE!! | @AntoineTroupe", :yt_description=>"Shoutout to Famous To Most!\n\nChoreographed by: Antoine Troupe\nSong: Famous To Most - #Whip\n\nSolos (In order):\n\nCodie Wiggins\nAntoine Troupe \nYani Francesca\nCyntoria Lampkin\nAmanda Grind \n\nGuys Group (From left to right):\n\nDakota Smith\nCodie Wiggins\nAntoine Troupe\nAjaye Skeene"}, {:id=>68, :url=>"DJbclMflsBU", :yt_author=>"1MILLION Dance Studio", :yt_pub_date=>"2015-05-13T12:07:25.000Z", :yt_count=>"681924", :yt_title=>"Eunho Kim Choreography / Sugar - Maroon 5", :yt_description=>"www.1milliondance.com"}, {:id=>71, :url=>"WMZ0PaYyzME", :yt_author=>"Luam Keflezgy", :yt_pub_date=>"2015-04-08T21:49:12.000Z", :yt_count=>"7548", :yt_title=>"Luam teaches Madonna 'Gang Bang'", :yt_description=>"DAY 7 VIDEO 7: Luamworld Comeback\nDancers: Valentine Norton, Diana Matos, Jovanni Soto, Mark Cruz, Bo Park, Chino Zapata\nNew York, New York"}, {:id=>112, :url=>"knBnikk5P0w", :yt_author=>"Tony Tzar", :yt_pub_date=>"2015-06-05T00:00:54.000Z", :yt_count=>"11741", :yt_title=>"Black Light Society is NOT DEAD| Choreography By @TonyTzar", :yt_description=>"Black Light Society is not Dead.  \nIt's a Society.\n\nChoreographer: Tony Tzar\nDancers: Black Light Society\n\nMusic: In Order \n\n1.\"Where My (___) At\"? - Kaytranada\n2. Lunch Money- Pusha-T(Myth Syzer Edit)\n\n  Message:  Don't Try Me.  You're Too Late.  Find You & Do you.  Love over Errthang.\n\nCinematographer: Jordan Hunter\n\nEvent: Dance Fight"}, {:id=>56, :url=>"jGLmo72PMT0", :yt_author=>"WHOGOTSKILLZ", :yt_pub_date=>"2015-09-23T12:54:52.000Z", :yt_count=>"7008", :yt_title=>"Misha Gabriel | Dirt Off Your Shoulder/Lying From You | Whogotskillz Beat Camp 2015", :yt_description=>"Come and visit us:\nWEBSITE: http://www.thebeatcamp.com\nFACEBOOK: http://www.facebook.com/thebeatcamp\nYOUTUBE: http://www.youtube.com/whogotskillz\n\nPhoto & Video: \n\nNikola Janusic Photography: http://www.nikolajanusic.com\n\n- - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - \n\nChoreography by: Misha Gabriel\nSong by: Jay-Z vs. Linkin Park \"Dirt Off Your Shoulder/Lying From You\" - Remix\n\n- - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - \nWHAT? WHO? WHERE? WHEN?\n- - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - -\nWHOGOTSKILLZ BEAT CAMP\nYOUR ULTIMATE SUMMER DANCE EXPERIENCE\n- - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - -\n\nWhere else can you combine the ultimate summer vacation with your passion for hip hop dance?\n \nWHOGOTSKILLZ BEAT CAMP is an international dance event on the beautiful island of Pag in Croatia. The event is being held in Novalja city which is located right next to one of the hottest summer spots in Europe - ZRCE BEACH. \n\nWhogotskillz Beat Camp offers you high quality dance training as well as afternoon beach parties! Choose between various workshops by day and attend a party cruise with some of your favorite choreographers in the afternoon! \n\nFor all dancers interested in experiencing the ultimate summer dance vacation,\nWHOGOTSKILLZ BEAT CAMP is the place to be!\n\n- - - - - - - - - - - - - - - - - - - - - - - -\n15 days and nights\n22+ choreographers and teachers\n50+ classes in total\n75+ hours of dancing\n- - - - - - - - - - - - - - - - - - - - - - - -\nNovalja I Pag Island I Croatia\n- - - - - - - - - - - - - - - - - - - - - - - -\nStay tuned for more information\nhttp://www.thebeatcamp.com\ninfo@thebeatcamp.com\n\nYour WhoGotSkillz Team!\n\n\nWHOGOTSKILLZ BEAT CAMP is an event organized by URBAN DANCE GMBH\n- - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - \n- - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - \n2015 © THEBEATCAMP\n2015 © WHOGOTSKILLZ\n- - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - \n- - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - \n- - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - -"}, {:id=>67, :url=>"boYBrXIUWzY", :yt_author=>"WilldaBeast Adams", :yt_pub_date=>"2015-09-28T23:35:45.000Z", :yt_count=>"349138", :yt_title=>"Britney , Nicki Minaj ,