ed. With that said, thank you for taking part in the long crazy night of learning, staging, and shooting for this video! I love my squad!\n\n“what if it just kept going?\"\n\nDancers: The Company\n\nHomies: The Manampers & The Welby Warriors\n\nFilmed by: Gerald Nonato & Chad Mayate\n\nEdited by: Nick Kim, Gerald Nonato, & Jon Shih\n\nHope you enjoy!!"}, {:id=>83, :url=>"Y5NYrMG7P90", :yt_author=>"TheKinjaz", :yt_pub_date=>"2015-10-13T08:12:17.000Z", :yt_count=>"188167", :yt_title=>"Craig David - Fill Me In Pt. 2 | Choreography | KINJAZ", :yt_description=>"Combining styles from two different worlds, comes a collaboration between none other than Pat Cruz and Michael “Mpact” Lor.  Gaining inspiration from life's simple, feel-good vibes… here’s that expression in movement.\n\nBrotherhood at all costs.\n\n\n\n\nGo forth, and join the KIN on our social media!\n\nOFFICIAL WEBSITE & MERCHANDISE\nhttp://www.KINJAZ.com\n\n@Kinjaz\n\nTWITTER\nhttp://twitter.com/kinjaz\n\nINSTAGRAM\nhttp://instagram.com/kinjaz\n\nFACEBOOK\nhttp://facebook.com/kinjaz\n\nBOOKING\nbooking@kinjaz.com"}, {:id=>20, :url=>"OuXIo_xTmto", :yt_author=>"YANIS MARSHALL", :yt_pub_date=>"2015-02-02T20:43:06.000Z", :yt_count=>"8979463", :yt_title=>"YANIS MARSHALL HEELS CHOREOGRAPHY \"7/11\" BEYONCÉ. MILLENNIUM IN LOS ANGELES. FILMED BY @timmilgram", :yt_description=>"PLEASE WATCH in 720p / 1080p for an HD QUALITY \nWatch the alternate version, CLICK HERE: http://youtu.be/OTwguQleWx8\n\nYanis Marshall Heel's choreography Filmed at Millennium Dance Complex in North Hollywood, CA\n\nFilmed/Edited by Tim Milgram: http://youtube.com/timmilgram \n\nFeaturing: Darrion Gallegos & Marissa Heart\n\n~ a T.Milly Production ~\n\n\nI can't even begin to express how happy and Proud I am ... Thank you sooooooo much Los Angeles for this amazing energy !!! Thank you for all the love and support and for making my first class at Millennium Dance complex packed as fuck and Sold Out !!! #YanisWORLDTourBitch !!! Merci Beaucoup … \