ing special. I couldn't have done it without these talented artists and Mike's creative eye.\n\nI hope you enjoy it, I'm extremely excited to share this."}, {:id=>60, :url=>"LBKv-UWoPlM", :yt_author=>"Fordham Flava", :yt_pub_date=>"2014-04-05T15:54:46.000Z", :yt_count=>"1780", :yt_title=>"WORK - Iggy Azalea | Fordham Flava & Mode Magazine", :yt_description=>"Song: Work\nArtist: Iggy Azalea\n\n**NO COPYRIGHT INFRINGEMENT INTENDED*** \"This video uses copyrighted material in a manner that does not require approval of the copyright holder. It is a fair use under copyright law.\n\"quotation of excerpts in a review or criticism for purposes of illustration or comment; quotation of short passages in a scholarly or technical work, for illustration or clarification of the author's observations; use in a parody of some of the content of the work parodied; summary of an address or article, with brief quotations, in a news report; reproduction by a library of a portion of a work to replace part of a damaged copy; reproduction by a teacher or student of a small part of a work to illustrate a lesson; reproduction of a work in legislative or judicial proceedings or reports; incidental and fortuitous reproduction, in a newsreel or broadcast, of a work located in the scene of an event being reported.\""}, {:id=>75, :url=>"eigySIJWe-I", :yt_author=>"saekell", :yt_pub_date=>"2015-10-03T02:32:55.000Z", :yt_count=>"4766", :yt_title=>"@MightyMykell & Millennium | World Changing Women #WCW", :yt_description=>"*No Copyright Infringement, for creative purposes ONLY*\n\n#WCW\nA World Changing Woman isn't a perfect individual but one who continuously finds the willingness to grow and discover themselves in the way of perfect love and respect for self. She is a woman who allows her weaknesses and strengths to contribute to the building of her character. She is easy to love because she has first demonstrated her worth in the ability to love herself. She is a woman born to nurture the world around her. \n\nI joined New Age Gents and Millennium Dance Complex to release a powerful message to EVERY woman on earth. I see your potential and I invest Love into it! YOU matter!!!!!\n\nDancers:\nArie Bodenhausen\nCyntoria Lampkin\nDevan Smith\nElysandra Quinones \nJasmine Perri\nKaren Song\nKelly \"Sheskp\" Pahamotang \nMelissa Locke\nMona Berntsen\nTatiana Parker \n\nThank You Millennium Dance Complex and Jin Lee\n\nChoreography and Message: Mykell Wilson aka @MightyMykell\nFilmed by: Q Burdette"}, {:id=>103, :url=>"_cbNqoAeRto", :yt_author=>"Tricia Miranda", :yt_pub_date=>"2015-11-27T17:02:00.000Z", :yt_count=>"6407651", :yt_title=>"Missy Elliott - WTF (Where They From) @_TriciaMiranda Choreography - Filmed by @TimMilgram", :yt_description=>"Get the TUTORIAL: https://gumroad.com/a/947008627 \nWatch ADDITIONAL GROUPS: https://youtu.be/K0gJXZtW7iE\nChoreography by Tricia Miranda\nFilmed & Edited by Tim Milgram: http://youtube.com/timmilgram\nMissy Elliott - WTF (Where They From) ft Pharrell Williams\n\nFollow us: \nhttp://instagram.com/1triciamiranda\nhttp://instagram.com/timmilgram \n\nFeaturing: Darrion Gallegos, Josh Killacky, Kaycee Rice, China Taylor, Zach Lattimore, Taylor Thomas, Darina Littleton, LaToyna Swaan, Allison Buczkowski, Zach Hudson, Angelo Saunders, Ashanti McIntosh, Bailey Sok, Aidan Prince Xiong\n\n\n~ a T.Milly Production ~"}, {:id=>92, :url=>"f-dAWIiqmiA", :yt_author=>"George jones jr.", :yt_pub_date=>"2015-11-12T17:00:16.000Z", :yt_count=>"849", :yt_title=>"\"Electric\" Omarion | @GeorgeJonesJr | @mdcdance", :yt_description=>"Shot By: @qburdette\nLocation: Millennium Dance Complex\n\nClass Every Tuesday/ Thursday 8PM-9PM"}, {:id=>90, :url=>"Iyw9Lu3Y3sU", :yt_author=>"jeromeesplana", :yt_pub_date=>"2015-11-09T19:57:41.000Z", :yt_count=>"9281", :yt_title=>"Mobb Deep ft. Lil Kim - Quiet Storm | Jerome Esplana Choreography | @jeromeesplana @lilkim @mobbdeep", :yt_description=>"Here's one section of my recent piece i put together for \"The MainEvent\" showcase that happened a few days ago here in Vancouver, BC.\n\nIt's such a dope feeling where you don't have to be (the choreographer) in the middle or front to see your choreography/vision come to life.  These dancers here clearly show that they hold their own.  They are such hard working dancers!  From new friends to old friends, it was a hella fun experience working with them!\n\nI want to show you guys how talented and hungry Vancouver dancers are, well.. here you go!\n\nEnjoy!\n\nand look out for these guys, because they be goin' in all day!\n\ndancers -\n@czarinayso\n@tayloraller\n@jessyhinola\n@abbyzaporteza\n@aya_ykym  (ayaka yokoyama)\n@jptarlit\n@jakealler\n@jonbongato\n@erikperena\n@jeskoguiang\n@simdum  (kelvin tu)\n@nicklouiee\n@jasonpamintuan\n@christiaanpow\n@princenii\n@jadrianzvee\n\ngo give them a follow on IG and TWITTER!\n\nthanks y'all!"}, {:id=>80, :url=>"KAfOI37aK4A", :yt_author=>"ChrisBrownVEVO", :yt_pub_date=>"2015-09-23T10:00:30.000Z", :yt_count=>"18227327", :yt_title=>"Chris Brown - Liquor / Zero (Explicit Version)", :yt_description=>"Chris Brown's new album \"Royalty\" Available now! Get it on:\nApple Music: http://smarturl.it/Royalty?IQid=yt\nListen on Spotify: http://smarturl.it/sRoyalty?IQid=yt\nAmazon Music: http://smarturl.it/aRoyalty?IQid=yt\nGoogle Play: http://smarturl.it/gRoyalty?IQid=yt\n\nFollow Chris Brown: \nhttp://www.chrisbrownworld.com/ \nhttps://www.facebook.com/chrisbrown \nhttps://twitter.com/chrisbrown \nhttp://instagram.com/chrisbrownofficial \nhttp://smarturl.it/CBSpotify?IQid=yt"}, {:id=>7, :url=>"wSTzuvIljH0", :yt_author=>"Tucker Barkley", :yt_pub_date=>"2015-08-21T16:53:03.000Z", :yt_count=>"15168", :yt_title=>"Tucker Barkley | F*ck The Summer Up", :yt_description=>"Choreographer @Tuckerbarkley                                   Dancers                                     @Taylormaas                           @Kyraaoakee                       @Tuckerbarkley                    @amanda_grind                  