d Feemstro adm. by Universal Music - Z Tunes Llc (ASCAP)\nProduced By: Skrillex and BLOOD\n\nhttp://vevo.ly/bTcKdI\n\n©: 2015 Def Jam Recordings, a division of UMG Recordings, Inc."}, {:id=>50, :url=>"IfzMRhp5vlE", :yt_author=>"URBAN DANCE CAMP", :yt_pub_date=>"2014-05-29T20:18:38.000Z", :yt_count=>"3450221", :yt_title=>"Treasure - Bruno Mars / Chris Martin Dance Choreography / 310XT Films / URBAN DANCE CAMP", :yt_description=>"• WB: http://theUrbanDanceCamp.com\n• FB: http://facebook.com/theUrbanDanceCamp\n• YT: http://youtube.com/UrbanDanceCamp\n\n• CHOREOGRAPHER : Chris Martin (San Diego, USA)\n• SONG : \"Treasure\" by Bruno Mars (Official Music)\n• DANCERS (L to R) : Kevin Arnold Algabre (CH), Adrien Rako (CH), Joseph Tsosh (GR), Ben Uili (NZ) & Patrick Cruz (US)\n\n• FILM PRODUCTION : http://www.310XT.com\n\n• ABOUT THE UDC : The Urban Dance Camp is the world's leading dance intensive education. The annual international workshop event has become after many years the best summer intensive for studio-styles (choreography) as well as streetdance-styles, with the highest standard of teaching and unique talents from around the world. The Urban Dance Camp presents every year an amazing line up with dance legends, youtube stars and top international choreographers from Asia, Europe and the USA. All of them proved their skills in the past years and become the best and most qualified educators for choreography-oriented participants. \n\nThe UDC 2016 offers you more than 170 classes over a period of 50 days. The workshops are ideal for dancers, teachers and choreographers with experiences. The level of the classes is for intermediate, advanced and professional dancers. The UDC is not for beginners, who never danced before. Age restriction: Participants have to be at least 16 years. \n\nEnjoy 255 hours of workshops with up to 33 teachers and participants from USA, Canada, Australia, United Kingdom, Germany, France, Spain, Italy, Israel, Japan, Mexico, Russia, China, Singapore and many more! \n\n////////////////////////////////////////////////////////////////\n• WEBSITE : www.theUrbanDanceCamp.com\n• CONTACT : info@theUrbanDanceCamp.com"}, {:id=>23, :url=>"3R4ppTsxe7E", :yt_author=>"Keone and Mari", :yt_pub_date=>"2012-03-23T03:28:32.000Z", :yt_count=>"498331", :yt_title=>"Keone Madrid | The way you make me feel", :yt_description=>"No concept or story behind this. Just wanted to explore the art of MJ. It's pretty hard to find good, genuine music these days. So going back to blasting MJ on the speakers never fails. *Michael Scream* OOOOOOOh ... Miss you Mike!\n-Keone\n\n\u2028\u2028TWITTER:\u2028\nhttp://twitter.com/marrrrriel\n\u2028http://twitter.com/keonemadrid\n\n\u2028\u2028FACEBOOK:\n\u2028http://facebook.com/martin.mariel\n\u2028http://facebook.com/madrid.keone\n\n\u2028\u2028SUBSCIBE:\n\u2028http://youtube.com/keoneANDmari\u2028\n\nCLOTHING:\nFor the Choreo Cookies hats and shirts be sure to shop online at http://www.studio429.com \nHats are shipping now! Shirts will be available online soon\n\nGRAPHICS:\nJason Patio\nPhoebe Smith\n\nDANCERS:\nYuko Nakamura\nChris Martin\nCarlo Darang\nMariel Martin\n\nCAMERA MAN:\nMark Andrew Porky\n\n\u2028MUSIC:\n\u2028YOU SHOULD KNOW ALREADY!!!\n\n\u2028*COPYRIGHT INFRINGEMENT NOT INTENDED* \n\u2028\"Copyright Disclaimer Under Section 107 of the Copyright Act 1976, allowance is made for \"fair use\" for purposes such as criticism, comment, news reporting, teaching, scholarship, and research. Fair use is a use permitted by copyright statute that might otherwise be infringing. Non-profit, educational or personal use tips the balance in favor of fair use.\""}, {:id=>76, :url=>"1oIwO0VKlKY", :yt_author=>"Antoine Troupe", :yt_pub_date=>"2015-10-04T02:26:55.000Z", :yt_count=>"1435826", :yt_title=>"K Camp x Chris Brown - Lil Bit | @AntoineTroupe Choreography", :yt_description=>"I want to hear from you directly. Text me your comments: +18183517947\n\nI choreographed this in Poland. I had a great trip there teaching for the Street Dance Academy and wanted to create something fun for all the students in my night class. Sadly I didn't get footage of that class but this was still a really great class I had back in LA at Millenium Dance Complex. Hope you enjoy."}]
